function Invoke-SSHCommand {
<#

.Description
    This script was created to easily send commands to SSH servers.

.Parameter IP
    The string containing the IP or hostname of the target server.
    
.Parameter Username
    The username for the ssh server

.Parameter Password
    The password for the ssh server

.Parameter KeyFile
    A base64 encoded private key.

.Parameter Port
    The port for the ssh server

.Parameter Command
    The command to run on the ssh server

.Example
    Invoke-SSHCommand -ip 192.168.1.100 -Username root -Password test -Command "id"

#>
    param(
        [Parameter(Mandatory=$true)]
        [String]
        $Ip,

        [Parameter(Mandatory=$true)]
        [String]
        $Username,

        [Parameter(Mandatory=$false)]
        [String]
        $Password,

        [Parameter(Mandatory=$false)]
        [String]
        $EncodedKeyFile,

        [Parameter(Mandatory=$false)]
        [Int]
        $Port,

        [Parameter(Mandatory=$true)]
        [String]
        $Command
    )

    $Base64Dll = ""
    $Content = [System.Convert]::FromBase64String($Base64Dll)
    try
    {
        [System.Reflection.Assembly]::Load($Content)
    }
    catch
    {
        "[!] Error loading dll"  | Out-String
        Break
    }

    Try
    {
        If($EncodedKeyFile)
        {
            $KeyFile = [System.Convert]::FromBase64String($EncodedKeyFile)
            $KeyFile = [System.IO.MemoryStream]$KeyFile
            $PrivateKeyFile = New-Object Renci.SshNet.PrivateKeyFile($KeyFile)
            $PrivateKeyAuthenticationMethod = New-Object Renci.SshNet.PrivateKeyAuthenticationMethod($Username, $PrivateKeyFile)

            If($Password)
            {
                $PasswordAuthenticationMethod = New-Object Renci.SshNet.PasswordAuthenticationMethod($Username,$Password)
                $ConnectionInfo = New-Object Renci.SshNet.ConnectionInfo($Ip, $Port, $Username, $PasswordAuthenticationMethod, $PrivateKeyAuthenticationMethod)
            }
            Else
            {
                $ConnectionInfo = New-Object Renci.SshNet.ConnectionInfo($Ip, $Port, $Username, $PrivateKeyAuthenticationMethod)
            }
        }
        ElseIf($Password)
        {
            $PasswordAuthenticationMethod = New-Object Renci.SshNet.PasswordAuthenticationMethod($Username,$Password)
            $ConnectionInfo = New-Object Renci.SshNet.ConnectionInfo($Ip, $Port, $Username, $PasswordAuthenticationMethod)
        }
        Else
        {
            "[!] Required: Password or Keyfile!" | Out-String
        }

        $SSHClient = New-Object Renci.SshNet.SSHClient($ConnectionInfo)
        $SSHClient.Connect()
        $SSHClient.RunCommand($command).Result
        $SSHClient.Disconnect()
    } Catch {
        "[!] Error establishing connection!"  | Out-String
    }
}
